window.bookSummaryJSON = "<p>Power, Love, Money: Pick One</p> <p>I’m her father’s best friend. She’s twenty years younger than me. He’ll kill me if I touch her—but I’ll die if I don’t.</p> <p>The last time I saw Lia Ferreo I was helping her with a skinned knee—and now she wants to run her father’s company. She has no idea the dark lengths her father and I went through to build the mafia-financed hotel empire we currently run, or where any of the bodies are buried, but I know better.</p> <p>So much better.</p> <p>Lia’s gentle, I’m cruel.</p> <p>She’s innocent, I’m a murderer.</p> <p>She deserves to be free—all I want to do is control her.</p> <p>And I don’t think I can hold back my beast around her much longer....</p> <p>Take Her: A Dark Wall Street Mafia Age Gap Romance is like if the movie Secretary met the TV show Succession, with a Beauty and the Beast themed twist. It is the first book in Cassie Alexander's The Moth and the Monster series, and marks her stunning contemporary debut.</p>"; 
